import React from 'react';
import './Receipt.css'
import img from './samples/receipt.png'
import axios from 'axios'


const Receipt=() => {

  let url = '/api/'+ number
  axios.get(url).then(function(res){
     console.log(res.data);
     if(res.data==null){
       console.log("unique")
       history.push('./car-details/'+number);
     }
     else
     {
         console.log("Lll");
         history.push('./receipt/'+number);
     }

     
 })

  return(
  <>
  <div className="body">
    <div className="receipt-title">
      Parking Receipt
    </div>
    <div className="receipt-pic">

        <img src={img} alt="CAR"></img>
    </div>
    <div className="receipt-car">
        <div className="receipt-car-title">
            <div><h4> Parking Details</h4></div>

            <div>{props.id}</div>
        </div>
    
        <div className="receipt-car-name">
            <div> {props.color}, {props.model}<br/> {props.plateNumber}</div>

            <div>Slot No. :- {props.slot}</div>
        </div>

    </div>
    <div className="receipt-right">
        
        <div> Parking History ></div>

      </div>
  </div>
  </>)

}

export default Receipt;
